class Solution {
    public List<String> numerical_letter_grade(List<Double> grades) {
        List<String> result = new ArrayList<>();
        Object[][] gradeMap = {
            {4.0, Double.POSITIVE_INFINITY, "A+"},
            {3.7, 4.0, "A"},
            {3.3, 3.7, "A-"},
            {3.0, 3.3, "B+"},
            {2.7, 3.0, "B"},
            {2.3, 2.7, "B-"},
            {2.0, 2.3, "C+"},
            {1.7, 2.0, "C"},
            {1.3, 1.7, "C-"},
            {1.0, 1.3, "D+"},
            {0.7, 1.0, "D"},
            {0.0, 0.7, "D-"},
            {Double.NEGATIVE_INFINITY, 0.0, "E"}
        };

        for (double grade : grades) {
            for (Object[] range : gradeMap) {
                if ((double) range[0] <= grade && grade < (double) range[1]) {
                    result.add((String) range[2]);
                    break;
                }
            }
        }

        return result;
    }
}

