class Solution {
    public boolean check_if_last_char_is_a_letter(String txt) {
        if (txt.isEmpty()) {  // check if the string is empty
            return false;
        }
        if (txt.charAt(txt.length() - 1) == ' ') {  // check if the last character is a space
            return false;
        }
        String[] words = txt.split("\\s+");  // split the string into words
        String lastWord = words[words.length - 1];  // get the last word
        if (lastWord.length() == 1) {  // check if the last word has only one character
            return Character.isLetter(lastWord.charAt(0));  // check if the last character is a letter
        }
        return false;
    }
}

