class Solution {
    public List<Integer> minPath(List<List<Integer>> grid, int k) {
        int n = grid.size();
        int[][] directions = {{0, 1}, {0, -1}, {1, 0}, {-1, 0}};
        int[] minPath = new int[k];
        Arrays.fill(minPath, Integer.MAX_VALUE);

        dfs(grid, k, 0, 0, new int[k], 0, directions, minPath);

        List<Integer> result = new ArrayList<>();
        for (int i = 0; i < k; i++) {
            result.add(minPath[i]);
        }
        return result;
    }

    private void dfs(List<List<Integer>> grid, int k, int i, int j, int[] path, int index, int[][] directions, int[] minPath) {
        if (index == k) {
            if (compare(path, minPath) < 0) {
                System.arraycopy(path, 0, minPath, 0, k);
            }
            return;
        }
        for (int[] direction : directions) {
            int ni = i + direction[0];
            int nj = j + direction[1];
            if (ni >= 0 && ni < grid.size() && nj >= 0 && nj < grid.get(0).size()) {
                path[index] = grid.get(ni).get(nj);
                dfs(grid, k, ni, nj, path, index + 1, directions, minPath);
            }
        }
    }

    private int compare(int[] path1, int[] path2) {
        for (int i = 0; i < path1.length; i++) {
            if (path1[i] < path2[i]) {
                return -1;
            } else if (path1[i] > path2[i]) {
                return 1;
            }
        }
        return 0;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
