class Solution {
    public String fix_spaces(String text) {
        StringBuilder result = new StringBuilder();
        int spaceCount = 0;
        for (char c : text.toCharArray()) {
            if (c == ' ') {
                spaceCount++;
            } else {
                if (spaceCount > 2) {
                    result.append("-");
                } else if (spaceCount > 0) {
                    result.append("_");
                }
                spaceCount = 0;
                result.append(c);
            }
        }
        if (spaceCount > 2) {
            result.append("-");
        } else if (spaceCount > 0) {
            result.append("_");
        }
        return result.toString();
    }
}

