class Solution {
    public String solve(int N) {
        // Convert the integer to a string to easily iterate over its digits
        String str_N = Integer.toString(N);

        // Initialize a variable to store the sum of the digits
        int sum_of_digits = 0;

        // Iterate over each digit in the string representation of N
        for (char digit : str_N.toCharArray()) {
            // Add the integer value of the digit to the sum
            sum_of_digits += Character.getNumericValue(digit);
        }

        // Convert the sum of the digits to a binary string and return it
        return Integer.toBinaryString(sum_of_digits);
    }
}

