class Solution {
    public int fibfib(int n) {
        if (n <= 1) {
            return 0;
        } else if (n == 2) {
            return 1;
        } else {
            int[] fibfibSeq = new int[n + 1];
            fibfibSeq[0] = 0;
            fibfibSeq[1] = 0;
            fibfibSeq[2] = 1;
            for (int i = 3; i <= n; i++) {
                fibfibSeq[i] = fibfibSeq[i - 1] + fibfibSeq[i - 2] + fibfibSeq[i - 3];
            }
            return fibfibSeq[n];
        }
    }
}

