class Solution {
    public List<Object> reverse_delete(String s, String c) {
        // Remove characters from s that are in c
        StringBuilder resultString = new StringBuilder();
        for (char ch : s.toCharArray()) {
            if (c.indexOf(ch) == -1) {
                resultString.append(ch);
            }
        }

        // Check if the result string is a palindrome
        String str = resultString.toString();
        boolean isPalindrome = str.equals(new StringBuilder(str).reverse().toString());

        // Return the result string and the palindrome check
        List<Object> result = new ArrayList<>();
        result.add(str);
        result.add(isPalindrome);
        return result;
    }
}

