class Solution {
    public String change_base(int x, int base) {
        if (x == 0) {
            return "0";
        }
        StringBuilder digits = new StringBuilder();
        while (x > 0) {
            digits.insert(0, x % base);
            x /= base;
        }
        return digits.toString();
    }
}

