class Solution {
    public int fib4(int n) {
        if (n <= 1) {
            return 0;
        } else if (n == 2) {
            return 2;
        } else if (n == 3) {
            return 0;
        }

        int[] fib4Values = new int[] {0, 0, 2, 0};
        for (int i = 4; i <= n; i++) {
            int nextValue = fib4Values[0] + fib4Values[1] + fib4Values[2] + fib4Values[3];
            fib4Values[0] = fib4Values[1];
            fib4Values[1] = fib4Values[2];
            fib4Values[2] = fib4Values[3];
            fib4Values[3] = nextValue;
        }

        return fib4Values[3];
    }
}

