class Solution {
    public List<Integer> parse_music(String string) {
        Map<String, Integer> notes = new HashMap<>();
        notes.put("o", 4);
        notes.put("o|", 2);
        notes.put(".|", 1);

        List<Integer> result = new ArrayList<>();
        int i = 0;
        while (i < string.length()) {
            if (i + 1 < string.length() && notes.containsKey(string.substring(i, i + 2))) {
                result.add(notes.get(string.substring(i, i + 2)));
                i += 2;
            } else {
                result.add(notes.get(string.substring(i, i + 1)));
                i += 1;
            }
        }
        return result;
    }
}

