class Solution {
    /**
    Circular shift the digits of the integer x, shift the digits right by shift
    and return the result as a string.
    If shift > number of digits, return digits reversed.
    >>> circular_shift(12, 1)
    "21"
    >>> circular_shift(12, 2)
    "12"
     */
    public String circular_shift(int x, int shift) {
        String numStr = String.valueOf(x);
        int numDigits = numStr.length();
        shift = shift % numDigits;
        if (shift == 0) {
            StringBuilder sb = new StringBuilder(numStr);
            return sb.reverse().toString();
        } else {
            String lastShiftChars = numStr.substring(numDigits - shift);
            String remainingChars = numStr.substring(0, numDigits - shift);
            return lastShiftChars + remainingChars;
        }
    }
}

