class Solution {
    public int specialFilter(List<Integer> nums) {
        int count = 0;
        for (Integer num : nums) {
            if (Math.abs(num) > 10) {
                int lastDigit = Math.abs(num) % 10;
                int firstDigit = Integer.parseInt(String.valueOf(Math.abs(num)).substring(0, 1));
                if (isOdd(lastDigit) && isOdd(firstDigit)) {
                    count++;
                }
            }
        }
        return count;
    }

    private boolean isOdd(int digit) {
        return digit == 1 || digit == 3 || digit == 5 || digit == 7 || digit == 9;
    }
}

