class Solution {
    /**
    Given a positive integer n, return the count of the numbers of n-digit
    positive integers that start or end with 1.
     */
    public int starts_one_ends(int n) {
        // Calculate the total number of n-digit positive integers
        long totalNumbers = 9 * (long) Math.pow(10, n - 1);

        // Calculate the number of n-digit positive integers that start with 1
        long startsWithOne = (long) Math.pow(10, n - 1);

        // Calculate the number of n-digit positive integers that end with 1
        long endsWithOne = 9 * (long) Math.pow(10, n - 2) * 9;

        // Subtract the numbers that start and end with 1 to avoid double counting
        long startsAndEndsWithOne = 9 * (long) Math.pow(9, n - 2) * 9;

        // Return the total count of numbers that start or end with 1
        return (int) (startsWithOne + endsWithOne - startsAndEndsWithOne);
    }
}

