class Solution {
    public boolean is_multiply_prime(int a) {
        boolean[] primes = new boolean[100];
        for (int i = 0; i < 100; i++) {
            primes[i] = true;
        }
        primes[0] = primes[1] = false;
        for (int i = 2; i * i < 100; i++) {
            if (primes[i]) {
                for (int j = i * i; j < 100; j += i) {
                    primes[j] = false;
                }
            }
        }
        for (int i = 2; i < 100; i++) {
            if (primes[i]) {
                for (int j = 2; j < 100; j++) {
                    if (primes[j]) {
                        for (int k = 2; k < 100; k++) {
                            if (primes[k] && i * j * k == a) {
                                return true;
                            }
                        }
                    }
                }
            }
        }
        return false;
    }
}

