class Solution {
    public List<Integer> order_by_points(List<Integer> nums) {
        List<Map.Entry<Integer, Integer>> list = new ArrayList<>();
        for (int i = 0; i < nums.size(); i++) {
            int sum = sumOfDigits(nums.get(i));
            list.add(new AbstractMap.SimpleEntry<>(sum, i));
        }
        Collections.sort(list, (a, b) -> {
            if (a.getKey().equals(b.getKey())) {
                return Integer.compare(nums.get(a.getValue()), nums.get(b.getValue()));
            } else {
                return Integer.compare(a.getKey(), b.getKey());
            }
        });
        List<Integer> result = new ArrayList<>();
        for (Map.Entry<Integer, Integer> entry : list) {
            result.add(nums.get(entry.getValue()));
        }
        return result;
    }

    private int sumOfDigits(int num) {
        int sum = 0;
        String str = String.valueOf(Math.abs(num));
        for (char c : str.toCharArray()) {
            sum += Character.getNumericValue(c);
        }
        return sum;
    }
}

