class Solution {
    public List<Integer> sort_array(List<Integer> arr) {
        Collections.sort(arr, new Comparator<Integer>() {
            @Override
            public int compare(Integer a, Integer b) {
                int countA = Integer.bitCount(Math.abs(a));
                int countB = Integer.bitCount(Math.abs(b));
                if (countA == countB) {
                    return a - b;
                } else {
                    return countA - countB;
                }
            }
        });
        return arr;
    }
}

