class Solution {
    public Object split_words(String txt) {
        // First, try to split on whitespace
        String[] words = txt.split("\\s+");
        if (words.length > 1) {
            return Arrays.asList(words);
        }

        // If no whitespace, try to split on commas
        words = txt.split(",");
        if (words.length > 1) {
            return Arrays.asList(words);
        }

        // If no commas, count the number of lower-case letters with odd order in the alphabet
        int count = 0;
        for (char c : txt.toCharArray()) {
            if (Character.isLowerCase(c) && (c - 'a') % 2 != 0) {
                count++;
            }
        }
        return count;
    }
}

