class Solution {
    public boolean will_it_fly(List<Integer> q, int w) {
        // Check if the list is palindromic
        boolean isBalanced = isPalindrome(q);

        // Calculate the sum of the elements in the list
        int totalWeight = sumOfElements(q);

        // Check if the total weight is less than or equal to the maximum possible weight
        boolean isWithinWeightLimit = totalWeight <= w;

        // Return True if the object is balanced and within the weight limit, False otherwise
        return isBalanced && isWithinWeightLimit;
    }

    // Helper method to check if a list is palindromic
    private boolean isPalindrome(List<Integer> list) {
        int left = 0;
        int right = list.size() - 1;
        while (left < right) {
            if (!list.get(left).equals(list.get(right))) {
                return false;
            }
            left++;
            right--;
        }
        return true;
    }

    // Helper method to calculate the sum of elements in a list
    private int sumOfElements(List<Integer> list) {
        int sum = 0;
        for (Integer element : list) {
            sum += element;
        }
        return sum;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.will_it_fly(new ArrayList<>(Arrays.asList(3, 2, 3)), 9),
                !s.will_it_fly(new ArrayList<>(Arrays.asList(1, 2)), 5),
                s.will_it_fly(new ArrayList<>(List.of(3)), 5),
                !s.will_it_fly(new ArrayList<>(Arrays.asList(3, 2, 3)), 1),
                !s.will_it_fly(new ArrayList<>(Arrays.asList(1, 2, 3)), 6),
                s.will_it_fly(new ArrayList<>(List.of(5)), 5)
        );
