class Solution {
    public int search(List<Integer> lst) {
        Map<Integer, Integer> count = new HashMap<>();
        for (Integer num : lst) {
            count.put(num, count.getOrDefault(num, 0) + 1);
        }
        int result = -1;
        for (Integer num : count.keySet()) {
            if (count.get(num) >= num && num > result) {
                result = num;
            }
        }
        return result;
    }
}

