class Solution {
    public String file_name_check(String file_name) {
        // Check if the file name contains exactly one dot
        if (file_name.indexOf('.') != file_name.lastIndexOf('.')) {
            return "No";
        }

        // Split the file name into two parts: before and after the dot
        String[] parts = file_name.split("\\.");
        String name = parts[0];
        String extension = parts[1];

        // Check if the substring before the dot starts with a letter
        if (!Character.isLetter(name.charAt(0))) {
            return "No";
        }

        // Check if the substring before the dot is not empty
        if (name.length() == 0) {
            return "No";
        }

        // Check if the number of digits in the file name is not more than three
        int digitCount = 0;
        for (char c : name.toCharArray()) {
            if (Character.isDigit(c)) {
                digitCount++;
                if (digitCount > 3) {
                    return "No";
                }
            }
        }

        // Check if the substring after the dot is one of the allowed extensions
        String[] allowedExtensions = {"txt", "exe", "dll"};
        boolean isValidExtension = false;
        for (String ext : allowedExtensions) {
            if (extension.equals(ext)) {
                isValidExtension = true;
                break;
            }
        }
        if (!isValidExtension) {
            return "No";
        }

        return "Yes";
    }
}

