class Solution {
    public List<String> sorted_list_sum(List<String> lst) {
        // Filter out strings with odd lengths
        List<String> evenLengthStrings = new ArrayList<>();
        for (String s : lst) {
            if (s.length() % 2 == 0) {
                evenLengthStrings.add(s);
            }
        }

        // Sort the list by length of each word and then alphabetically
        Collections.sort(evenLengthStrings, new Comparator<String>() {
            @Override
            public int compare(String s1, String s2) {
                if (s1.length() == s2.length()) {
                    return s1.compareTo(s2);
                } else {
                    return Integer.compare(s1.length(), s2.length());
                }
            }
        });

        return evenLengthStrings;
    }
}

