class Solution {
    public List<Integer> pluck(List<Integer> arr) {
        List<Integer> evenNodes = new ArrayList<>();
        for (int i = 0; i < arr.size(); i++) {
            if (arr.get(i) % 2 == 0) {
                evenNodes.add(arr.get(i));
            }
        }
        if (evenNodes.isEmpty()) {
            return new ArrayList<>();
        }
        int smallestEvenValue = evenNodes.get(0);
        int smallestEvenIndex = arr.indexOf(smallestEvenValue);
        for (int i = 0; i < evenNodes.size(); i++) {
            int currentValue = evenNodes.get(i);
            int currentIndex = arr.indexOf(currentValue);
            if (currentValue < smallestEvenValue || (currentValue == smallestEvenValue && currentIndex < smallestEvenIndex)) {
                smallestEvenValue = currentValue;
                smallestEvenIndex = currentIndex;
            }
        }
        List<Integer> result = new ArrayList<>();
        result.add(smallestEvenValue);
        result.add(smallestEvenIndex);
        return result;
    }
}

