class Solution {
    public Optional<Integer> prod_signs(List<Integer> arr) {
        if (arr.isEmpty()) {
            return Optional.empty();
        }

        int sumMagnitudes = 0;
        int productSigns = 1;
        for (int num : arr) {
            sumMagnitudes += Math.abs(num);
            if (num < 0) {
                productSigns *= -1;
            } else if (num == 0) {
                return Optional.of(0);
            }
        }

        return Optional.of(sumMagnitudes * productSigns);
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.prod_signs(Arrays.asList(1, 2, 2, -4)).get() == -9,
                s.prod_signs(Arrays.asList(0, 1)).get() == 0,
                s.prod_signs(Arrays.asList(1, 1, 1, 2, 3, -1, 1)).get() == -10,
                s.prod_signs(List.of()).isEmpty(),
                s.prod_signs(Arrays.asList(2, 4,1, 2, -1, -1, 9)).get() == 20,
                s.prod_signs(Arrays.asList(-1, 1, -1, 1)).get() == 4,
                s.prod_signs(Arrays.asList(-1, 1, 1, 1)).get() == -4,
                s.prod_signs(Arrays.asList(-1, 1, 1, 0)).get() == 0
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

