class Solution {
    public List<Integer> tri(int n) {
        List<Integer> tribonacciSequence = new ArrayList<>();
        tribonacciSequence.add(1);
        tribonacciSequence.add(3);
        if (n == 0) {
            return tribonacciSequence.subList(0, 1);
        } else if (n == 1) {
            return tribonacciSequence.subList(0, 2);
        }
        tribonacciSequence.add(2);
        for (int i = 3; i <= n; i++) {
            if (i % 2 == 0) {
                tribonacciSequence.add(1 + i / 2);
            } else {
                int nextNumber = tribonacciSequence.get(i - 2) + tribonacciSequence.get(i - 3) + tribonacciSequence.get(i - 1);
                tribonacciSequence.add(nextNumber);
            }
        }
        return tribonacciSequence;
    }
}

