class Solution {
    public int prime_fib(int n) {
        int a = 0;
        int b = 1;
        int count = 0;
        while (true) {
            if (isPrime(b)) {
                count++;
                if (count == n) {
                    return b;
                }
            }
            int temp = a;
            a = b;
            b = temp + b;
        }
    }

    public boolean isPrime(int num) {
        if (num < 2) {
            return false;
        }
        for (int i = 2; i <= Math.sqrt(num); i++) {
            if (num % i == 0) {
                return false;
            }
        }
        return true;
    }
}

