                !s.is_prime(1),
                s.is_prime(5),
                s.is_prime(11),
                s.is_prime(17),
                !s.is_prime(5 * 17),
                !s.is_prime(11 * 7),
                !s.is_prime(13441 * 19)
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
