                s.is_equal_to_sum_even(8) == true,
                s.is_equal_to_sum_even(10) == true,
                s.is_equal_to_sum_even(11) == false,
                s.is_equal_to_sum_even(12) == true,
                s.is_equal_to_sum_even(13) == false,
                s.is_equal_to_sum_even(16) == true
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

