class Solution {
    public List<Optional<Integer>> largest_smallest_integers(List<Integer> lst) {
        List<Integer> negatives = new ArrayList<>();
        List<Integer> positives = new ArrayList<>();

        for (Integer num : lst) {
            if (num < 0) {
                negatives.add(num);
            } else if (num > 0) {
                positives.add(num);
            }
        }

        Optional<Integer> largestNegative = negatives.isEmpty() ? Optional.empty() : Optional.of(Collections.max(negatives));
        Optional<Integer> smallestPositive = positives.isEmpty() ? Optional.empty() : Optional.of(Collections.min(positives));

        List<Optional<Integer>> result = new ArrayList<>();
        result.add(largestNegative);
        result.add(smallestPositive);

        return result;
    }
}

